import React, { Fragment } from 'react';
import Card from './card';
import indiefetto2 from '../Indiefetto2.png'
import styles from './footericons.css'
import Modal from './modaleform'


const ThreeColumnsPage = () => {
    return (

        <Fragment>
        <div className="flex flex-col sm:flex-row ">
            <div className="sm:w-1/2 p-4 mt-10 ">
                <img className='rounded-full ' src={indiefetto2} />
            </div>
            <div className="sm:w-1/2 p-4">
                <Card />
            </div>

            <div className='container'>
            <Modal />
            </div>
           

            
            
        </div>
     
        </Fragment>
        
    );
};

export default ThreeColumnsPage;
